import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";

const hospedagens = [
  {
    id: 1,
    nome: "Novíssimo Trend",
    descricao: "Casa para 2 hóspedes",
    preco: "R$ 186,00/noite",
    imagem: "https://a0.muscache.com/im/pictures/9a4677d9-8344-4c61-b8da-c8a8af473daa.jpg?im_w=1200",
  },
  {
    id: 2,
    nome: "FLAT COM VISTA INCRÍVEL EM FORTALEZA",
    descricao: "Casa para 2 hóspedes",
    preco: "R$ 200,00",
    imagem: "https://a0.muscache.com/im/pictures/5ac70395-9dc0-47f3-b9d6-6d3df4b90591.jpg?im_w=1440",
  }
]

function criarCard(hospedagens: any) {
  return (
    <Card
      key={hospedagens.id}
      nome={hospedagens.nome}
      descricao={hospedagens.descricao}
      preco={hospedagens.preco}
      imagem={hospedagens.imagem}
    />
  );
}

export default function Home() {
  return (
      <div>
      <h1>Hospedagens</h1>
      <dl className="dictionary">{hospedagens.map(criarCard)}</dl>
      </div>
  );
}
